import React from 'react';


const TeamChannelList = ({children, error = false, loading, type}) => {
 

  return (
    <div>
      <div>
        <p>{type === 'team' ? 'Channels' : 'Direct Messages'}</p>
      </div>
      {children}
    </div>
  )

};

export default TeamChannelList;
